import React from "react";

const NotMatching = () => {
    let x = props.x;
    let y = props.y;
    let z = props.z;
  return (
    <>
      <h1>
        {x} {y} {z}
      </h1>
      <h1> This is not Matching :( </h1>
      <hr />
    </>
  );
};

export default NotMatching;
